pub fn deinit(self: *HangulMap) void {
    if (singleton) |*s| {
        s.ref_count -= 1;
        if (s.ref_count == 0) {
            self.map.deinit();
            self.allocator.destroy(s.instance);
            singleton = null;
        }
    }
}

/// syllableType maps the code point to its Hangul Syllable Type.
pub fn syllableType(self: HangulMap, cp: u21) ?Kind {
    return self.map.get(cp);
}
